package Day201501

import "strconv"

// Entry holds wraps the data and runner interfaces for this puzzle
var Entry testDay

type testDay bool

func (td testDay) PartOne(inputData string) (string, error) {
	floor := 0

	for _, runeValue := range inputData {
		if runeValue == '(' {
			floor++
		} else {
			floor--
		}
	}
	return strconv.Itoa(floor), nil
}

func (td testDay) PartTwo(inputData string) (string, error) {
	floor := 0
	postition := 0
	for _, runeValue := range inputData {
		postition++
		if runeValue == '(' {
			floor++
		} else {
			floor--
		}

		if floor < 0 {
			break
		}
	}
	return strconv.Itoa(postition), nil
}

func (td testDay) Day() int {
	return 01
}

func (td testDay) Year() int {
	return 2015
}

func (td testDay) Title() string {
	return "Not Quite Lisp"
}


